const IvoiceStats = ({ items }) => {
    return (
        <div>
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>#</th>
                <th>Jméno/Název</th>
                <th>Výdělek</th>
              </tr>
            </thead>
            <tbody>
              {items.map((item, index) => (
                <tr key={index + 1}>
                  <td>{index + 1}</td>
                  <td>{item.personName}</td>
                  <td>{item.revenue}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      );
    };

export default InvoiceStats;
